import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from './Navbar';

const LoginForm = ({ setIsAuthenticated }) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const [isAuthenticated, setLocalIsAuthenticated] = useState(false);
    const [userName, setUserName] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const savedUser = localStorage.getItem('user');
        if (savedUser) {
            const user = JSON.parse(savedUser);
            setIsAuthenticated(true);
            setLocalIsAuthenticated(true);
            setUserName(user.name);
        } else {
            fetch('https://task-app-server-07x5.onrender.com/check_session')
                .then(response => response.json())
                .then(data => {
                    if (data.id) {
                        setIsAuthenticated(true);
                        setLocalIsAuthenticated(true);
                        setUserName(data.name);
                        localStorage.setItem('user', JSON.stringify(data));
                    }
                })
                .catch(error => console.error('Error:', error));
        }
    }, [setIsAuthenticated]);

    const handleLogin = (e) => {
        e.preventDefault();

        fetch('https://task-app-server-07x5.onrender.com/login', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ email, password })
        })
        .then((response) => response.json())
        .then((data) => {
            if (data.id) {
                setIsAuthenticated(true);
                setLocalIsAuthenticated(true);
                setUserName(data.name);
                localStorage.setItem('user', JSON.stringify(data));
                navigate('/');
            } else {
                setError(data.error || 'Login failed');
            }
        })
        .catch((error) => {
            setError('An error occurred. Please try again.');
        });
    };

    const handleLogout = () => {
        fetch('https://task-app-server-07x5.onrender.com/logout', {
            method: 'DELETE'
        })
        .then(() => {
            setIsAuthenticated(false);
            setLocalIsAuthenticated(false);
            setUserName('');
            localStorage.removeItem('user');
            navigate('/');
        })
        .catch((error) => {
            console.error('Error:', error);
        });
    };

    return (
        <div style={{ padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
            <Navbar />
            {isAuthenticated ? (
                <div style={{ textAlign: 'center', marginTop: '20px' }}>
                    <h2>Welcome, {userName}</h2>
                    <button 
                        onClick={handleLogout}
                        style={{
                            padding: '10px 20px',
                            fontSize: '16px',
                            backgroundColor: '#343a40',
                            color: '#fff',
                            border: 'none',
                            borderRadius: '5px',
                            cursor: 'pointer',
                            marginTop: '10px'
                        }}
                    >
                        Logout
                    </button>
                </div>
            ) : (
                <form onSubmit={handleLogin} style={{ marginTop: '20px' }}>
                    <div style={{ marginBottom: '10px' }}>
                        <label>Email:</label>
                        <input
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                            style={{
                                width: '100%',
                                padding: '10px',
                                fontSize: '16px',
                                marginTop: '5px',
                                borderRadius: '5px',
                                border: '1px solid #ccc'
                            }}
                        />
                    </div>
                    <div style={{ marginBottom: '20px' }}>
                        <label>Password:</label>
                        <input
                            type="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                            style={{
                                width: '100%',
                                padding: '10px',
                                fontSize: '16px',
                                marginTop: '5px',
                                borderRadius: '5px',
                                border: '1px solid #ccc'
                            }}
                        />
                    </div>
                    <button 
                        type="submit"
                        style={{
                            width: '100%',
                            padding: '10px',
                            fontSize: '18px',
                            backgroundColor: '#343a40',
                            color: '#fff',
                            border: 'none',
                            borderRadius: '5px',
                            cursor: 'pointer'
                        }}
                    >
                        Login
                    </button>
                    {error && <p style={{ color: 'red', marginTop: '10px' }}>{error}</p>}
                </form>
            )}
        </div>
    );
};

export default LoginForm;
